  <script>
    var LOOPCOUNT = 100;
    var renderType = Kekule.Render.RendererType.R2D;
    var molIds = [/*'pyrrole', 'caffeine', 'mannitol', 'morphine', 'oxylate3D'/*, 'cyclodextrin3D',*/ 'largeChain2D'];

    function drawMol(drawElem, molId, loopCount)
    {
      /*
      var resStr = 'url(#' + molId + ')';
      Kekule.PredefinedResReferer.loadResource(resStr, function(resInfo, success)
      {
        if (success)
        {
          var mol = Kekule.IO.loadTypedData(resInfo.data, resInfo.resType, resInfo.resUri);
          // draw mol
          // clear parent elem
          Kekule.DomUtils.clearChildContent(parentElem);
          // create painter, bind with molecule
          var painter = new Kekule.Render.ChemObjPainter(renderType, mol);
          // create context inside parentElem
          var dim = Kekule.HtmlElementUtils.getElemOffsetDimension(parentElem); // get width/height of parent element
          var context = painter.createContext(parentElem, dim.width, dim.height); // create context fulfill parent element

          var profileId = molId;
          console.profile(profileId);
          var startTime = Date.now();
          // at last, draw the molecule at the center of context
          for (var i = 0; i < loopCount; ++i)
          {
            painter.draw(context, {'x': dim.width / 2, 'y': dim.height / 2});
          }
          var endTime = Date.now();
          //(function(){console.profileEnd(profileId);}).delay(10);
          console.profileEnd(profileId);

        }
      }, null, document);
      */
      var srcElem = document.getElementById(molId);
      var srcData = Kekule.DomUtils.getElementText(srcElem).trim();
      var mimeType = srcElem.getAttribute('type');
      var mol = Kekule.IO.loadMimeData(srcData, mimeType);

      // draw mol
      // clear parent elem
      Kekule.DomUtils.clearChildContent(drawElem);
      // create painter, bind with molecule
      var painter = new Kekule.Render.ChemObjPainter(renderType, mol);
      // create context inside parentElem
      var dim = Kekule.HtmlElementUtils.getElemOffsetDimension(drawElem); // get width/height of parent element
      var context = painter.createContext(drawElem, dim.width, dim.height); // create context fulfill parent element

      painter.draw(context, {'x': dim.width / 2, 'y': dim.height / 2});  // initial draw, create essential classes
      painter.finalize();

      var profileId = molId;
      console.profile(profileId);
      var startTime = Date.now();
      // at last, draw the molecule at the center of context
      for (var i = 0; i < loopCount; ++i)
      {
        var painter = new Kekule.Render.ChemObjPainter(renderType, mol);
        painter.draw(context, {'x': dim.width / 2, 'y': dim.height / 2});
      }
      var endTime = Date.now();
      (function(){console.profileEnd(profileId);}).delay(10);
      //console.profileEnd(profileId);

      return {
        'duration': endTime - startTime
      }
    }
    function logMsg(logElem, msg)
    {
      var elem = document.createElement('div');
      elem.innerHTML = msg;
      logElem.appendChild(elem);
    }

    function createTestRow(rootElem, molId)
    {
      var rowElem = document.createElement('section');
      rowElem.className = 'TestRow';
      var drawStageElem = document.createElement('div');
      drawStageElem.className = 'DrawStage';
      var logElem = document.createElement('div');
      logElem.className = 'Log';
      rowElem.appendChild(drawStageElem);
      rowElem.appendChild(logElem);
      rootElem.appendChild(rowElem);

      (function(){
        var result = drawMol(drawStageElem, molId, LOOPCOUNT, logElem);
        logMsg(logElem, 'duration: ' + result.duration);
      }).defer();
    }

    function run()
    {
      var rootElem = document.getElementById('root');
      Kekule.DomUtils.clearChildContent(rootElem);
      molIds.forEach(function(id){
        createTestRow(rootElem, id);
      });
    }

    function init()
    {
      Kekule.Widget.getWidgetById('btnExec').on('execute', run);
    }

    Kekule.X.domReady(init);
  </script>
</head>
<body>
  <div>
    <button id="btnExec" data-widget="Kekule.Widget.Button" data-text="Run"></button>
  </div>
  <article id="root"></article>
</body>
